thumbs.css:
.hades .sr7-thumb { 
      opacity:1
  }
.hades .sr7-thumb-img-wrap {
  border-radius:##radius##;
  padding:##border##px;
  display:inline-block;
  background-color:##bg##;
  width:100%;
  height:100%;
  position:relative;
  margin:0px;
  box-sizing:border-box;
    transition:all 0.3s;
    -webkit-transition:all 0.3s;
}
.hades .sr7-thumb-img {
   padding:##border##px; 
   border-radius:##radius##;
   display:block;
   box-sizing:border-box;
   position:relative;
    -webkit-box-shadow: inset 5px 5px 10px 0px rgba(0,0,0,0.25);
  -moz-box-shadow: inset 5px 5px 10px 0px rgba(0,0,0,0.25);
  box-shadow: inset 5px 5px 10px 0px rgba(0,0,0,0.25);
 }  


.hades .sr7-thumb.sr7-touchhover .sr7-thumb-img-wrap,
.hades .sr7-thumb.selected .sr7-thumb-img-wrap {


  background: -moz-linear-gradient(top, ##ht## 0%, ##hb## 100%);
  background: -webkit-gradient(left top, left bottom, color-stop(0%, ##ht##, color-stop(100%, ##hb##)));
  background: -webkit-linear-gradient(top, ##ht## 0%, ##hb## 100%);
  background: -o-linear-gradient(top, ##ht## 0%, ##hb## 100%);
  background: -ms-linear-gradient(top, ##ht## 0%, ##hb## 100%);
  background: linear-gradient(to bottom, ##ht## 0%, ##hb## 100%);
 }
